import React from 'react';
import '../Styles/Home.css'

const Home = () => (
  <section className="home-section">
    <h1>Suraj Bhandwalkar</h1>
    <p>Full Stack Developer | React.js | Node.js | MongoDB </p>
    <a href="mailto:suraj.b9930@gmail.com" className="btn">Contact Me</a>
  </section>
);

export default Home;
